import {Navigation} from './index.js';

import './about.css'

export async function About(props){
	await fetch('http://localhost:1337/api/educations', {
		method: 'GET',
		headers: {
			'Content-Type': 'application/json',
		},
	})
	.then(response => response.json())
	.then(data => {
		console.log(data);
		let component = (
				<div>
					<Navigation highlight='about'/>
				</div>
		);
	});

	return component; 

}

